package modelo;

public class Artista {

	public Artista() {
		// TODO Auto-generated constructor stub
		
	}
	

	private int codigo_artista;
	private String nombre_artista;
	private String genero_musica;
	private String nacionalidad;
	private String estado;
	
	
	
	public int getCodigo_artista() {
		return codigo_artista;
	}
	public void setCodigo_artista(int codigo_artista) {
		this.codigo_artista = codigo_artista;
	}
	public String getNombre_artista() {
		return nombre_artista;
	}
	public void setNombre_artista(String nombre_artista) {
		this.nombre_artista = nombre_artista;
	}
	public String getGenero_musica() {
		return genero_musica;
	}
	public void setGenero_musica(String genero_musica) {
		this.genero_musica = genero_musica;
	}
	public String getNacionalidad() {
		return nacionalidad;
	}
	public void setNacionalidad(String nacionalidad) {
		this.nacionalidad = nacionalidad;
	}
	public String getEstado() {
		return estado;
	}
	public void setEstado(String estado) {
		this.estado = estado;
	}
	
	
	
}
